import { Link } from "react-router-dom"

const DUMMY_EVENTS = [
    {
        id: 'e1',
        title: 'Some Event'
    },
    {
        id: 'e2',
        title: 'Some Other Event'
    },
]

function Events(){
    return (<>
    <h1>Events</h1>
    <ul>
        {DUMMY_EVENTS.map(e => <li key={e.id}><Link to={e.id}></Link>{e.title}</li>)}
    </ul>
    </>)
}

export default Events
